ly nameSystem Serif'=>'Phông chữ Serif Hệ thống','Font family nameSystem Sans-serif'=>'Phông chữ Sans-serif Hệ thống','Headline for the About patternÉtudes offers comprehensive consulting, management, design, and research solutions. Every architectural endeavor is an opportunity to shape the future.'=>'Études cung cấp các giải pháp tư vấn, quản lý, thiết kế và nghiên cứu toàn diện. Mỗi nỗ lực kiến trúc là một cơ hội để định hình tương lai.','Pattern titleTitle text and button on left with image on right'=>'Văn bản tiêu đề và nút ở bên trái, hình ảnh ở bên phải','Descriptive text for the feature areaThe revitalized Art Gallery is set to redefine the cultural landscape of Toronto, serving as a nexus of artistic expression, community engagement, and architectural marvel. The expansion and renovation project pay homage to the Art Gallery\'s rich history while embracing the future, ensuring that the gallery remains a beacon of inspiration.'=>'Phòng trưng bày nghệ thuật được hồi sinh sẽ tái định nghĩa bối cảnh văn hóa của Toronto, đóng vai trò là một trung tâm kết nối giữa biểu hiện nghệ thuật, sự tham gia của cộng đồng và kỳ quan kiến trúc. Dự án mở rộng và cải tạo bày tỏ lòng kính trọng đối với lịch sử phong phú của Phòng trưng bày Nghệ thuật đồng thời hướng tới tương lai, đảm bảo rằng phòng trưng bày vẫn là ngọn hải đăng của nguồn cảm hứng.','Descriptive title for the feature areaWith meticulous attention to detail and a commitment to excellence, we create spaces that inspire, elevate, and enrich the lives of those who inhabit them.'=>'Với sự chú ý tỉ mỉ đến từng chi tiết và cam kết với sự xuất sắc, chúng tôi tạo ra những không gian truyền cảm hứng, nâng cao và làm phong phú thêm cuộc sống của những người sử dụng chúng.','Title text for the feature areaThe revitalized art gallery is set to redefine cultural landscape.'=>'Phòng trưng bày nghệ thuật được hồi sinh sẽ tái định nghĩa bối cảnh văn hóa.','Sample feature headingRenovation and restoration'=>'Cải tạo và Phục hồi','Sub-heading of the featuresOur comprehensive suite of professional services caters to a diverse clientele, ranging from homeowners to commercial developers.'=>'Bộ dịch vụ chuyên nghiệp toàn diện của chúng tôi phục vụ đa dạng khách hàng, từ chủ nhà đến nhà phát triển thương mại.','Question in the FAQ patternI\'d like to get to meet fellow architects, how can I do that?'=>'Tôi muốn gặp gỡ các kiến trúc sư đồng nghiệp, tôi có thể làm điều đó như thế nào?','<em>Études</em> is not confined to the past—we are passionate about the cutting edge designs shaping our world today.'=>'<em>Études</em> không bị giới hạn bởi quá khứ—chúng tôi đam mê những thiết kế tiên tiến đang định hình thế giới ngày nay.','Pattern titleCentered statement'=>'Câu khẳng định trung tâm','Pattern titleCentered statement, small'=>'Câu khẳng định trung tâm, nhỏ','Sample list itemCase studies that celebrate architecture.'=>'Các nghiên cứu điển hình tôn vinh kiến trúc.','Answer in the FAQ patternÉtudes offers comprehensive consulting, management, design, and research solutions. Our vision is to be at the forefront of architectural innovation, fostering a global community of architects and enthusiasts united by a passion for creating spaces. Every architectural endeavor is an opportunity to shape the future.'=>'Études cung cấp các giải pháp tư vấn, quản lý, thiết kế và nghiên cứu toàn diện. Tầm nhìn của chúng tôi là đi đầu trong đổi mới kiến trúc, thúc đẩy một cộng đồng kiến trúc sư và những người đam mê toàn cầu, đoàn kết bởi niềm đam mê tạo ra không gian. Mỗi nỗ lực kiến trúc là một cơ hội để định hình tương lai.','Sample list itemA world of thought-provoking articles.'=>'Thế giới bài viết kích thích tư duy.','Sample subheading contentOur comprehensive suite of professional services caters to a diverse clientele, ranging from homeowners to commercial developers.'=>'Bộ dịch vụ chuyên nghiệp toàn diện của chúng tôi phục vụ đa dạng khách hàng, từ chủ nhà đến nhà phát triển thương mại.','